"23111":{"id":"23111","name":"Moscou em Nova York","slug":"moscou-em-nova-york","original_title":"Moscow on the Hudson","overview":"Um saxofonista do circo de Moscou sente uma incrível falta de liberdade em seu país. Quando o circo faz uma exibição em Nova York, Anatoly Cherkasov (Elya Baskin), o palhaço do circo, pensa em desertar e pedir asilo político, mas não consegue por ter uma crise nervosa. Mas Vladimir toma a decisão de desertar quando vão fazer compras na Bloomingdale's, onde é ajudado por Lionel Witherspoon (Cleavant Derricks), um segurança da loja que o convida a ficar em sua casa. Ivanoff faz uma lenta e dolorosa transição de cidadão russo para americano, sendo ajudado por Lucia Lombardo (Maria Conchita Alonso), uma vendedora da loja que acaba se tornando sua namorada. Lucia é italiana e sonha logo em ter sua cidadania legalizada. Vladimir também é ajudado por Orlando Ramirez (Alejandro Rey), um advogado especialista em imigração que há vinte anos atrás fugiu de Cuba em um pequeno barco. Vladimir vai se acostumando com os novos hábitos e conhece o estranho e apaixonante \"american way of life\".","first_air_date":"1984-04-06","runtime":115,"episode_run_time":[115],"vote_average":6.2,"created_by":["Bavaria Film","ML Delphi Premier Productions","Columbia Pictures"],"production_companies":[{"name":"Bavaria Film"},{"name":"ML Delphi Premier Productions"},{"name":"Columbia Pictures"}],"cast":["Robin Williams","María Conchita Alonso","Cleavant Derricks","Alejandro Rey","Савелий Крамаров"],"backdrop_path":"https://image.tmdb.org/t/p/original/qKZNKurkt3A8d3ga7wmYXfJFPAr.jpg","poster_path":"https://image.tmdb.org/t/p/original/uWb10jiBxDckvw12c3nsHLoXYYw.jpg","certification":"N/A","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
"602198":{"id":"602198","name":"Em Busca de Zoe","slug":"em-busca-de-zoe","original_title":"Saving Zoë","overview":"Faz um ano desde que sua irmã foi assassinada, mas Echo (Laura Marano) não consegue superar o ocorrido. A vida familiar está um caos, sua mãe toma muitos remédios e seu pai trabalha demais. No entanto, quando o antigo namorado de sua falecida irmã aparece com um diário, ela descobrirá muitos segredos escondidos.","first_air_date":"2019-07-12","runtime":95,"episode_run_time":[95],"vote_average":6.2,"created_by":["Calabrian Rhode Productions","Studio71","Blue Fox Entertainment"],"production_companies":[{"name":"Calabrian Rhode Productions"},{"name":"Studio71"},{"name":"Blue Fox Entertainment"}],"cast":["Laura Marano","Vanessa Marano","Chris Tavarez","Giorgia Whigham","Nathaniel Buzolic"],"backdrop_path":"https://image.tmdb.org/t/p/original/7tkspZXnSdgisaJOTTrj44WqexS.jpg","poster_path":"https://image.tmdb.org/t/p/original/uqotnP1wZ7tn03cFmbzPFLRYx8O.jpg","certification":"16","genres":["Drama","Mistério","Thriller"],"trailer":"OASmh1TV1VQ"},
"823951":{"id":"823951","name":"Novembro: Paris Atacado","slug":"novembro-paris-atacado","original_title":"Novembre","overview":"Em novembro de 2015, uma série de ataques mortais sem precedentes atinge Paris. A polícia antiterrorista liderada por Heloise e por seu Comandante-chefe Fred, enfrenta um nível de pressão sem precedentes: em uma corrida contra o relógio, eles devem encontrar os autores dos ataques o mais rápido possível antes que possam atacar novamente, em uma das maiores caçadas humanas da história.","first_air_date":"2022-10-05","runtime":105,"episode_run_time":[105],"vote_average":7.1,"created_by":["Chi-Fou-Mi Productions","Récifilms","uMedia","France 2 Cinéma","uFund","Canal+","La Banque Postale Image","StudioCanal"],"production_companies":[{"name":"Chi-Fou-Mi Productions"},{"name":"Récifilms"},{"name":"uMedia"},{"name":"France 2 Cinéma"},{"name":"uFund"},{"name":"Canal+"},{"name":"La Banque Postale Image"},{"name":"StudioCanal"}],"cast":["Jean Dujardin","Anaïs Demoustier","Sandrine Kiberlain","Jérémie Renier","Lyna Khoudri"],"backdrop_path":"https://image.tmdb.org/t/p/original/ks3WTeuEaenmMiizxXba65Rxpu1.jpg","poster_path":"https://image.tmdb.org/t/p/original/8QQzSfs588vBG0Xe9wIIr5d2BaE.jpg","certification":"N/A","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
"13193":{"id":"13193","name":"Galera do Mal","slug":"galera-do-mal","original_title":"Saved!","overview":"Mary (Jena Malone) é uma boa menina que estuda em uma instituição prostestante e ajuda ao próximo sempre que possível. Quando seu namorado (Chad Faust) se descobre homossexual, ela tem uma visão divina e tenta ajudá-lo, mas acaba ficando grávida. Temendo ser enviada a uma casa de misericórdia, Mary tenta a todo custo esconder sua gravidez. Ela passa a questionar sua crença nos valores em que sempre acreditou, se aproximando de Cassandra (Eva Amurri), a única judia da escola, que sempre teve uma visão contrária à religião.","first_air_date":"2004-06-11","runtime":92,"episode_run_time":[92],"vote_average":6.4,"created_by":["United Artists","Single Cell Pictures","Infinity Media","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"United Artists"},{"name":"Single Cell Pictures"},{"name":"Infinity Media"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Jena Malone","Mandy Moore","Macaulay Culkin","Patrick Fugit","Eva Amurri"],"backdrop_path":"https://image.tmdb.org/t/p/original/ybPJWtkbX42gR7YwCjxv60Rvvng.jpg","poster_path":"https://image.tmdb.org/t/p/original/5RvSXBfX40lLZFfRVL9z5BkfW4m.jpg","certification":"N/A","genres":["Comédia"],"trailer":"N/A"},
