"511449":{"id":"511449","name":"Sangue da Família","slug":"sangue-da-familia","original_title":"Family Blood","overview":"Ellie, uma viciada em drogas em recuperação, se muda para uma nova cidade com seus dois filhos adolescentes. Ela teve dificuldades para se manter sóbria no passado e está determinada a fazer isso funcionar dessa vez, encontrando um emprego estável e indo de forma regular as reuniões de apoio. Infelizmente, novos amigos, um novo trabalho, e uma nova chance na vida, não são capazes de impedir que Ellie tenha uma nova recaída. A vida dela muda quando conhece Christopher – um tipo diferente de viciado –, que junta forças com os filhos dela para aceitar uma nova versão de Ellie.","first_air_date":"2018-03-16","runtime":92,"episode_run_time":[92],"vote_average":4.6,"created_by":["Blumhouse Productions","Gunpowder & Sky","Divide / Conquer"],"production_companies":[{"name":"Blumhouse Productions"},{"name":"Gunpowder & Sky"},{"name":"Divide / Conquer"}],"cast":["Vinessa Shaw","James Ransone","Colin Ford","Eloise Lushina","Ajiona Alexus"],"backdrop_path":"https://image.tmdb.org/t/p/original/yW24SgbXDITTDn3t5OzPWGGd1pG.jpg","poster_path":"https://image.tmdb.org/t/p/original/uQ8SC6wCARc0pOTrHMCr8cFoHms.jpg","certification":"N/A","genres":["Terror","Thriller"],"trailer":"N/A"},
"30347":{"id":"30347","name":"Crimes no Paraíso 2","slug":"crimes-no-paraiso-2","original_title":"Jesse Stone: Death in Paradise","overview":"Stone investiga o brutal assassinato de uma adolescente problemática encontrada morta boiando em um lago da cidade. Ele logo descobre que a garota era uma estudante exemplar e que, de alguma maneira, acabou no caminho da autodestruição, o que eventualmente levou à morte prematura. À medida que Stone descobre mais coisas sobre o passado infeliz da garota, ele começa a suspeitar que o mundo influente de Boston pode estar envolvido e passa a ficar obcecado com o caso. Determinado a encontrar o assassino, Stone vai fazer o impossível para solucionar este assassinato no paraíso.","first_air_date":"2006-04-30","runtime":87,"episode_run_time":[87],"vote_average":6.9,"created_by":["Sony Pictures Television","Brandman Productions","TWS Productions II"],"production_companies":[{"name":"Sony Pictures Television"},{"name":"Brandman Productions"},{"name":"TWS Productions II"}],"cast":["Tom Selleck","Viola Davis","Kohl Sudduth","Orla Brady","Gary Basaraba"],"backdrop_path":"https://image.tmdb.org/t/p/original/fpcJd8at9DjozVfX3cSfQCyxulz.jpg","poster_path":"https://image.tmdb.org/t/p/original/bC2jgOwpcDK5zq7rohngu70NL45.jpg","certification":"16","genres":["Crime","Thriller","Mistério","Cinema TV"],"trailer":"N/A"},
