"215211":{"id":"215211","name":"Grace de Mônaco","slug":"grace-de-monaco","original_title":"Grace of Monaco","overview":"O casamento de Grace Kelly e o príncipe Rainier III foi considerado um conto de fadas na vida real quando aconteceu, em 1956. Entretanto, cinco anos mais tarde e com dois filhos, a verdade é que Grace está insatisfeita com a vida no palácio e o distanciamento do marido. A chance de novamente sentir-se útil surge quando seu velho amigo, o diretor Alfred Hitchcock, a convida para retornar ao cinema como protagonista de seu próximo filme: \"Marnie - Confissões de uma Ladra\". O problema é que Rainier é terminantemente contra e, ainda por cima, está envolvido com uma ameaça vinda do presidente francês Charles de Gaule: caso Mônaco não pague impostos à França e acabe com o paraíso fiscal existente, o principado será invadido em seis meses. Em meio às inevitáveis tensões, Grace e Rainier buscam resolver seus problemas tentando evitar que eles causem o divórcio.","first_air_date":"2014-04-22","runtime":103,"episode_run_time":[103],"vote_average":6.0,"created_by":["Stone Angels","Gaumont","TF1 Films Production","Lucky Red","uFilm","Silver Reel","uMedia","Od Shots","YRF Entertainment","Canal+"],"production_companies":[{"name":"Stone Angels"},{"name":"Gaumont"},{"name":"TF1 Films Production"},{"name":"Lucky Red"},{"name":"uFilm"},{"name":"Silver Reel"},{"name":"uMedia"},{"name":"Od Shots"},{"name":"YRF Entertainment"},{"name":"Canal+"}],"cast":["Nicole Kidman","Milo Ventimiglia","Paz Vega","Tim Roth","Parker Posey"],"backdrop_path":"https://image.tmdb.org/t/p/original/rwvzWkGHuNyY0r26mPznWuN13Qk.jpg","poster_path":"https://image.tmdb.org/t/p/original/vPx7H2ER7cKjpcgv8eRgp0J9Vgu.jpg","certification":"12","genres":["Romance","Drama"],"trailer":"N/A"},
