"132316":{"id":"132316","name":"Te Amarei Até a Morte","slug":"te-amarei-ate-a-morte","original_title":"जब तक है जान","overview":"Samar Anand (SRK), um oficial do Esquadrão Anti-Bombas do Exército Indiano, conhece Akira (Anushka Sharma), uma repórter do Discovery Channel que quer produzir um documentário sobre Samar, o detentor do recorde de números de bombas desativadas, conhecido como 'O homem que não pode morrer'. Ela se apaixona pelo soldado e descobre a história de amor entre ele e Meera (Katrina Kaif), uma garota de Londres que, dez anos atrás fez a promessa de deixar Samar para sempre, se em troca, sua vida fossa salva de um acidente.","first_air_date":"2012-11-13","runtime":176,"episode_run_time":[176],"vote_average":7.1,"created_by":["Yash Raj Films"],"production_companies":[{"name":"Yash Raj Films"}],"cast":["शाहरुख़ ख़ान","Katrina Kaif","Anushka Sharma","Sarika","Andrew Bicknell"],"backdrop_path":"https://image.tmdb.org/t/p/original/6BDBY1KhGHznQfCjHdGyIwNp30x.jpg","poster_path":"https://image.tmdb.org/t/p/original/lMFxyRlcXyN3UYJ3lbTQJiZGjSW.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"226140":{"id":"226140","name":"Noite do Terror 2","slug":"noite-do-terror-2","original_title":"See No Evil 2","overview":"Jacob Goodnight levanta entre os mortos do necrotério da cidade após a carnificina do Hotel Blackwell. Sobram alguns estudantes de medicina, que precisam lutar pela sobrevivência contra um psicopata decidido a matá-los.","first_air_date":"2014-10-21","runtime":90,"episode_run_time":[90],"vote_average":5.3,"created_by":["WWE Studios","Lionsgate"],"production_companies":[{"name":"WWE Studios"},{"name":"Lionsgate"}],"cast":["Danielle Harris","Glenn Jacobs","Kaj-Erik Eriksen","Katharine Isabelle","Chelan Simmons"],"backdrop_path":"https://image.tmdb.org/t/p/original/uPkbev4PHRJBwRLD2xFrg3dpFMk.jpg","poster_path":"https://image.tmdb.org/t/p/original/4ivCpKrcVWTTIODQtXo4RzvPUa.jpg","certification":"N/A","genres":["Terror"],"trailer":"N/A"},
"16211":{"id":"16211","name":"Os Filhos de Katie Elder","slug":"os-filhos-de-katie-elder","original_title":"The Sons of Katie Elder","overview":"Os quatro filhos de Katie Elder voltam a sua cidade natal para o funeral da mãe. John (John Wayne), o mais velho, é um notório pistoleiro. Tom é o jogador, Matt, o mais quieto, e Bud, o mais novo. Chegando lá, eles descobrem que seu pai, bêbado, apostou a fazenda da família num jogo e foi morto na mesma noite. Apesar das recomendações do xerife, os irmãos resolvem investigar o caso. Morgan Hastings e seu filho Dave, únicas testemunhas do assassinato, matam o xerife para se protegerem e os Elder são considerados culpados. O xerife substituto, Ben Latta, se une aos Hastings contra os irmãos Elder.","first_air_date":"1965-06-23","runtime":122,"episode_run_time":[122],"vote_average":7.0,"created_by":["Paramount Pictures","Hal Wallis Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"Hal Wallis Productions"}],"cast":["John Wayne","Dean Martin","Martha Hyer","Michael Anderson Jr.","Earl Holliman"],"backdrop_path":"https://image.tmdb.org/t/p/original/u9Yrx1ZYMSvtujeCRlLbNON8hR2.jpg","poster_path":"https://image.tmdb.org/t/p/original/n6ox5IniBxxx6ISTol5pm36WoFr.jpg","certification":"N/A","genres":["Faroeste"],"trailer":"N/A"},
"26978":{"id":"26978","name":"Caçador do Espaço: Aventura na Zona Proibida","slug":"cacador-do-espaco-aventura-na-zona-proibida","original_title":"Spacehunter: Adventures in the Forbidden Zone","overview":"Uma explosiva e eletrizante aventura espacial estrelada por Peter Strauss, como um generoso caçador galáctico, ameaçador por uma estranha criatura mecânica. É o ano de 3136, e Wolff (Strauss), respondendo a um sinal de socorro do planeta agora dominado pela força, sequestradas pelo ditador Overdog (Michael Ironside) o imoral meio-homem/meio-máquina que governa o planeta e Wolff sai em desenfreada perseguição. Enquanto desafia monstros e mutantes variados, as circunstâncias o atiram para junto de Niki (Molly Ringwald), uma lutadora solitária que concorda em guiá-lo ao reino de sucatas de Overdog. Da exploração de Wolff na Zona Proibida uma vibrante ação extraterrestre, garantida por efeitos especiais de perder o fôlego.","first_air_date":"1983-05-20","runtime":90,"episode_run_time":[90],"vote_average":5.3,"created_by":["Delphi Productions","Zone Productions","Columbia Pictures"],"production_companies":[{"name":"Delphi Productions"},{"name":"Zone Productions"},{"name":"Columbia Pictures"}],"cast":["Peter Strauss","Molly Ringwald","Ernie Hudson","Andrea Marcovicci","Michael Ironside"],"backdrop_path":"https://image.tmdb.org/t/p/original/j1kaXXDebYDZLR3Nj3OUXOJbQPg.jpg","poster_path":"https://image.tmdb.org/t/p/original/Aj5xRw7O11Hq8n0cBgwziIYvGuJ.jpg","certification":"N/A","genres":["Aventura","Ficção científica"],"trailer":"N/A"},
"484638":{"id":"484638","name":"15 Minutos de Guerra","slug":"15-minutos-de-guerra","original_title":"L'Intervention","overview":"Baseado nos eventos reais ocorridos em Djibouti no ano de 1976, quando terroristas somalianos sequestraram um ônibus escolar com 21 crianças francesas e uma professora americana, tentando levá-los a um território inabitado, localizado entre a colônia francesa e a Somália. O capitão francês André Gerval é chamado para liderar um time de atiradores de elite com o objetivo de preparar uma operação de resgate. Com a diplomacia falhando e o tempo se esgotando, Gerval e seu time são os únicos capazes de salvar as crianças e a professora.","first_air_date":"2019-01-30","runtime":98,"episode_run_time":[98],"vote_average":6.8,"created_by":["Capture The Flag Films","Playtime"],"production_companies":[{"name":"Capture The Flag Films"},{"name":"Playtime"}],"cast":["Olga Kurylenko","Alban Lenoir","Sébastien Lalanne","Michaël Abiteboul","Vincent Perez"],"backdrop_path":"https://image.tmdb.org/t/p/original/u4PhTSMSvlE7dE45I7ktXlje2Ea.jpg","poster_path":"https://image.tmdb.org/t/p/original/iwXNed7a2TERq4D7AUY3wltGrqw.jpg","certification":"14","genres":["Guerra","Ação","Drama","História"],"trailer":"N/A"},
