"274504":{"id":"274504","name":"Traumas de Infância","slug":"traumas-de-infancia","original_title":"The Adderall Diaries","overview":"O decadente escritor Stephen Elliott (James Franco, Planeta dos Macacos A Origem) fica obcecado por um crime de grande repercussão, envolvendo um empresário (Christian Slater, Amor à Queima-Roupa) que assassinou brutalmente a mulher. À medida que mergulha no complicado caso, Elliott é atormentado pelas lembranças de sua própria infância sofrida. Quando seu pai (Ed Harris, Apollo 13 Do Desastre ao Triunfo) reaparece misteriosamente, dizendo que todas as tenebrosas memórias do filho são inventadas, Elliott, com sua namorada Riana (Amber Heard, Machete Mata) vai procurar separar a realidade da ficção, mas rapidamente tudo foge do controle.","first_air_date":"2016-04-15","runtime":87,"episode_run_time":[87],"vote_average":5.3,"created_by":["Rabbit Bandini Productions","Windowseat Films"],"production_companies":[{"name":"Rabbit Bandini Productions"},{"name":"Windowseat Films"}],"cast":["James Franco","Amber Heard","Ed Harris","Christian Slater","Wilmer Valderrama"],"backdrop_path":"https://image.tmdb.org/t/p/original/yTP9tSiTkDArtmR4SLh22ulvfd1.jpg","poster_path":"https://image.tmdb.org/t/p/original/tK0g8O8Lb45VGT4aqLGQx0lpUBv.jpg","certification":"N/A","genres":["Thriller","Romance"],"trailer":"N/A"},
"13922":{"id":"13922","name":"O Grande Ataque","slug":"o-grande-ataque","original_title":"The Great Raid","overview":"O 6º batalhão do exército norte-americano recebe uma das missões mais ingratas possíveis: resgatar, nas Filipinas, cerca de 500 prisioneiros norte-americanos de guerra que estão nas mãos das tropas japonesas. Enfrentando as condições mais adversas, eles andam 30 milhas por trás das linhas inimigas para tentar cumprir a missão. Toda a tensão que os soldados enfrentam e o perigo iminente precisam ser controlados pelo líder da missão, que comanda tudo com braço firme, mas que também sabe dos perigos que serão enfrentados. A produção foi filmada em 2002, mas demorou algum tempo até ficar completamente pronta, sendo lançada somente em 2005. O filme apresenta uma história dramática ao mesmo tempo em que mescla ótimas cenas de ação, contando com fidelidade um caso real de heroísmo.","first_air_date":"2005-08-12","runtime":133,"episode_run_time":[133],"vote_average":6.6,"created_by":["Lawrence Bender Productions","Marty Katz Productions"],"production_companies":[{"name":"Lawrence Bender Productions"},{"name":"Marty Katz Productions"}],"cast":["Franklin D. Roosevelt","Benjamin Bratt","James Franco","Connie Nielsen","Logan Marshall-Green"],"backdrop_path":"https://image.tmdb.org/t/p/original/6gFB71pIo0PY3OOrojTQ97Qy8qq.jpg","poster_path":"https://image.tmdb.org/t/p/original/oRrZiRjRngPu493YzDGIrIrACai.jpg","certification":"N/A","genres":["Ação","História","Guerra"],"trailer":"N/A"},
