"417489":{"id":"417489","name":"Bon Cop, Bad Cop 2","slug":"bon-cop-bad-cop-2","original_title":"Bon Cop Bad Cop 2","overview":"Seis anos se passaram desde Martin Ward e David Bouchard reuniram-se em uma maneira espetacular na fronteira Quebec / Ontario. Os dois homens ficaram amigos, mas o tempo tem seu preço e eles não se falam há quase um ano. Neste segundo capítulo, Ward e Bouchard deve enfrentar uma importante quadrilha de roubo de carro que acaba por ser muito mais do que esperava: um onde os carros roubados servirá como bombas em um ataque terrorista bem planejado.","first_air_date":"2017-05-12","runtime":91,"episode_run_time":[91],"vote_average":6.4,"created_by":["Jessie Films","Item 7"],"production_companies":[{"name":"Jessie Films"},{"name":"Item 7"}],"cast":["Patrick Huard","Colm Feore","Erik Knudsen","Noam Jenkins","Sarah-Jeanne Labrosse"],"backdrop_path":"https://image.tmdb.org/t/p/original/cJmXtzMJM8dgYTlMysBPPSr0tB3.jpg","poster_path":"https://image.tmdb.org/t/p/original/rhflodbAhPvLgK5MUFPtBzXWF32.jpg","certification":"16","genres":["Ação","Crime","Comédia"],"trailer":"N/A"},
