"26817":{"id":"26817","name":"Médica, Bonita e Solteira","slug":"medica-bonita-e-solteira","original_title":"Sex and the Single Girl","overview":"Bob Weston é o top repórter de uma revista tabloide, desprezível mas altamente rentável, que deve seu sucesso a histórias destacando sexo. Helen Gurley Brown é uma jovem psicóloga brilhante e bonita de 23 anos, que é a autora do best-seller \"Sex and the Single Girl\". Weston percebe que Brown não irá lhe dar uma entrevista, porque ela já foi objeto de um dos seus desprezíveis artigos sensacionalistas. Então ele se disfarça como seu amigo e vizinho Frank Broderick, um fabricante de meias que é totalmente dominado por uma esposa ciumenta. Depois de várias sessões de terapia como paciente da atrativa Dr. Brown, surgem complicações quando o jornalista mulherengo começa a se apaixonar pela linda psicóloga.","first_air_date":"1964-12-25","runtime":110,"episode_run_time":[110],"vote_average":6.5,"created_by":["Fernwood Productions Inc.","Reynard","Warner Bros. Pictures"],"production_companies":[{"name":"Fernwood Productions Inc."},{"name":"Reynard"},{"name":"Warner Bros. Pictures"}],"cast":["Tony Curtis","Natalie Wood","Henry Fonda","Lauren Bacall","Mel Ferrer"],"backdrop_path":"https://image.tmdb.org/t/p/original/rPHvIqO4KuVPxlfwbsnROFbCzQB.jpg","poster_path":"https://image.tmdb.org/t/p/original/pI12O5kfQonHy6svQIhc59oOVJt.jpg","certification":"e 12","genres":["Comédia","Romance"],"trailer":"N/A"},
