"60378":{"id":"60378","name":"Hitler: Uma Carreira","slug":"hitler-uma-carreira","original_title":"Hitler - Eine Karriere","overview":"Admirável documentário de montagem, no qual são utilizados unicamente documentos de época, \"Hitler, Eine Karrier\" acompanha todo o percurso público de Adolf Hitler. Trata-se menos de um filme sobre a II Guerra Mundial e o extermínio dos judeus do que de uma obra sobre a imagem pública de Hitler e a evolução desta imagem. Realizado com a colaboração do historiador Joachim Fest, biógrafo de Hitler e autor de diversos estudos sobre o nacional-socialismo e a resistência alemã, o filme tem narração em voz off, além de trechos de discursos e da narrativa de noticiários cinematográficos, mas não inclui nenhuma entrevista contemporânea, recusando por conseguinte uma estrutura televisiva.","first_air_date":"1977-07-08","runtime":150,"episode_run_time":[150],"vote_average":7.4,"created_by":["Interart","Werner Rieb Produktion","Cine-art Munich"],"production_companies":[{"name":"Interart"},{"name":"Werner Rieb Produktion"},{"name":"Cine-art Munich"}],"cast":["Gert Westphal","Adolf Hitler","Ernest Bevin","Karl Brandt","Eva Braun"],"backdrop_path":"https://image.tmdb.org/t/p/original/ztDkizmVkL2nOQIduKRoqLUYqSc.jpg","poster_path":"https://image.tmdb.org/t/p/original/489v1GaPKczVsfuP7gWYbcPxNWY.jpg","certification":"16","genres":["Documentário","História"],"trailer":"N/A"},
