"91739":{"id":"91739","name":"Muito Barulho por Nada","slug":"muito-barulho-por-nada","original_title":"Much Ado About Nothing","overview":"Um relato moderno da comédia clássica de Shakespeare sobre dois pares de amantes com diferentes abordagens sobre o amor. Don Pedro (Reed Diamond) retorna de uma guerra acompanhado do irmão Don John (Sean Maher) e dois policiais, Benedick (Alexis Denisof) e Claudio (Fran Kranz), este último se apaixona perdidamente pela jovem Hero (Jillian Morgese). Enquanto os amigos tentam aproximar os dois, o irmão do nobre guerreiro arma uma conspiração para atrapalhar os planos de casamento dos jovens pombinhos Hero e Claudio.","first_air_date":"2013-05-28","runtime":107,"episode_run_time":[107],"vote_average":6.8,"created_by":["Bellwether Pictures"],"production_companies":[{"name":"Bellwether Pictures"}],"cast":["Amy Acker","Alexis Denisof","Nathan Fillion","Clark Gregg","Reed Diamond"],"backdrop_path":"https://image.tmdb.org/t/p/original/yFAewxspQeCYeY8rp9YdvBmMRwn.jpg","poster_path":"https://image.tmdb.org/t/p/original/tY8GYIHmgnA06kvfHKxZQ31mvNg.jpg","certification":"12 anos","genres":["Comédia"],"trailer":"N/A"},
