"319337":{"id":"319337","name":"13 Minutos","slug":"13-minutos","original_title":"Elser","overview":"Baseada em fatos reais, esta história decorre em 1939, em vésperas da 2ª Guerra Mundial, quando Hitler sobrevive à explosão de uma bomba durante um evento comemorativo de seu partido. Entre a saída de Hitler da comemoração e a explosão que o mataria, decorreram 13 minutos. O plano foi engendrado por Georg Elser, carpinteiro e cidadão comum indignado perante a perda de liberdade e os abusos cometidos pelo regime. Considerado traidor da pátria, Elser foi imediatamente preso, mas só executado em 1945, por ordem direta de Hitler, quando a Alemanha já estava a perder a guerra.","first_air_date":"2015-04-09","runtime":114,"episode_run_time":[114],"vote_average":6.8,"created_by":["Philipp Filmproduction","Lucky Bird Pictures","Delphi Medien","ARD"],"production_companies":[{"name":"Philipp Filmproduction"},{"name":"Lucky Bird Pictures"},{"name":"Delphi Medien"},{"name":"ARD"}],"cast":["Christian Friedel","Katharina Schüttler","Burghart Klaußner","Johann von Bülow","Felix Eitner"],"backdrop_path":"https://image.tmdb.org/t/p/original/zpFFDwv7RsWwQIRBHzUW7WGmycC.jpg","poster_path":"https://image.tmdb.org/t/p/original/lVVrVSQNeiisXVFLsfDLjMCz8Vm.jpg","certification":"14","genres":["História","Drama"],"trailer":"giTXUETynaY"},
