"34106":{"id":"34106","name":"Do Mundo Nada Se Leva","slug":"do-mundo-nada-se-leva","original_title":"You Can't Take It with You","overview":"Alice Sycamore (Jean Arthur) deseja apresentar Tony Kirby (James Stewart), seu noivo, à sua família, mas como ele provêm de uma família rica e influente e a sua é composta de pessoas extrovertidas e um tanto lunáticas, há um choque de comportamentos. Para completar, Anthony P. Kirby (Edward Arnold), o pai do seu noivo, já comprou todos os imóveis da região onde a família de Alice vive para um importante empreendimento, com exceção da casa de Alice. Sem este imóvel o projeto não pode ir adiante e, como há uma recusa em vender, este posicionamento gera um clima desfavorável entre as duas famílias.","first_air_date":"1938-09-01","runtime":126,"episode_run_time":[126],"vote_average":7.5,"created_by":["Columbia Pictures"],"production_companies":[{"name":"Columbia Pictures"}],"cast":["Jean Arthur","James Stewart","Lionel Barrymore","Edward Arnold","Mischa Auer"],"backdrop_path":"https://image.tmdb.org/t/p/original/As4GJO5V3SxbSDW8ZEWPnYtSZIg.jpg","poster_path":"https://image.tmdb.org/t/p/original/j7J2zAFDLYPdLCeRmW0JAkKygfZ.jpg","certification":"e Livre","genres":["Comédia","Romance"],"trailer":"N/A"},
"409164":{"id":"409164","name":"A Noite dos Mortos","slug":"a-noite-dos-mortos","original_title":"Boys in the Trees","overview":"É Halloween em 1997, e também a última noite na escola para dois adolescentes skatistas, que vão deixar para trás a fase escolar e adentrar na famosa fase adulta. Mas, para um deles, Corey, alguns assuntos do passado ainda precisam ser resolvidos envolvendo um velho conhecido da infância. Para isso, os dois vão embarcar em uma viagem apavorante através de suas memórias, sonhos e medos.","first_air_date":"2016-09-09","runtime":112,"episode_run_time":[112],"vote_average":6.6,"created_by":["Mushroom Pictures","White Hot Productions","South Australian Film Corporation","Screen Australia"],"production_companies":[{"name":"Mushroom Pictures"},{"name":"White Hot Productions"},{"name":"South Australian Film Corporation"},{"name":"Screen Australia"}],"cast":["Toby Wallace","Gulliver McGrath","Justin Holborow","Mitzi Ruhlmann","Terence Crawford"],"backdrop_path":"https://image.tmdb.org/t/p/original/lmfXyPBcnPUCP95X49MfXXAwTDL.jpg","poster_path":"https://image.tmdb.org/t/p/original/lFOSbI3TqqeW8z19DkyrNeAG1ix.jpg","certification":"N/A","genres":["Drama","Terror","Thriller"],"trailer":"N/A"},
"61667":{"id":"61667","name":"Habemus Papam","slug":"habemus-papam","original_title":"Habemus Papam","overview":"Após a morte do Papa, o Conclave reúne-se para eleger o seu sucessor. São necessárias várias votações até que se veja a fumaça branca no céu do Vaticano. Quando finalmente é eleito um cardeal, os fiéis amontoados na Praça São Pedro esperam em vão o novo soberano. O cardeal escolhido não parece pronto a suportar o peso de tal responsabilidade. Angústia? Depressão? Medo de não se sentir à altura? O mundo se inquieta, enquanto no Vaticano buscam-se soluções para superar a crise – entre elas o auxílio de um dos mais renomados psicanalistas da Itália.","first_air_date":"2011-04-15","runtime":105,"episode_run_time":[105],"vote_average":6.8,"created_by":["Sacher Film","Fandango","Le Pacte","France 3 Cinéma","Canal+","France Télévisions","RAI Cinema"],"production_companies":[{"name":"Sacher Film"},{"name":"Fandango"},{"name":"Le Pacte"},{"name":"France 3 Cinéma"},{"name":"Canal+"},{"name":"France Télévisions"},{"name":"RAI Cinema"}],"cast":["Michel Piccoli","Nanni Moretti","Margherita Buy","Jerzy Stuhr","Renato Scarpa"],"backdrop_path":"https://image.tmdb.org/t/p/original/1uXonw89exEjM0sekjJDWF2M3Bx.jpg","poster_path":"https://image.tmdb.org/t/p/original/5G7eQdSj6nUWTyjLIDK6k14hX4R.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"N/A"},
