"38828":{"id":"38828","name":"Deixados para Trás 3: Mundo em Guerra","slug":"deixados-para-tras-3-mundo-em-guerra","original_title":"Left Behind: World at War","overview":"No mundo profetizado do Livro da Revolução, o ícone global e líder mundial Nicolae Carpathia finalmente realizou o inimaginável – ele conseguiu unir o mundo em paz – e dar fim ao derramamento de sangue que dominava mundo desde o começo dos tempo. O presidente norte-americano, Gerald Fitzhugh sempre teve esse sonho e dedicou sua presidência para garantir que a nação mais poderosa do submundo e um relance aterrorizante de uma conspiração sinistra, Fitzugh deve admitir a agonizante verdade – a 3ª Guerra Mundial é iminente – e sua dedicação ao sonho da paz deixou os Estados Unidos da América sem poder de defesa. Com a ajuda do repórter investigativo Buck Williams e seu submundo Comando Tribulação, Fitzhugh luta contra o relógio, as barreiras insuperáveis e sua própria mente fechada para tentar achar uma maneira de impedir a morte de milhões de pessoas e talvez o próprio fim da história.","first_air_date":"2005-10-21","runtime":95,"episode_run_time":[95],"vote_average":4.1,"created_by":[],"production_companies":[],"cast":["Louis Gossett Jr.","Kirk Cameron","Brad Johnson","Jessica Steen","Gordon Currie"],"backdrop_path":"https://image.tmdb.org/t/p/original/q3MTbugL58otDxYOswUQgvT2c0G.jpg","poster_path":"https://image.tmdb.org/t/p/original/y0sZlyEBX1SeNonM4FrC9mvD59K.jpg","certification":"N/A","genres":["Ação","Aventura","Fantasia","Ficção científica","Thriller"],"trailer":"2QYcKEoC-2o"},
