"1092329":{"id":"1092329","name":"Jornada Para Belém","slug":"jornada-para-belem","original_title":"Journey to Bethlehem","overview":"Uma jovem carregando uma responsabilidade inimaginável. Um jovem dividido entre o amor e a honra. Um rei ciumento que não se deterá diante de nada para manter sua coroa. Esta aventura musical de Natal em live-action para toda a família mescla melodias clássicas de Natal com humor, fé e novas canções pop em uma releitura da maior história já contada, a história de Maria e José e o nascimento de Jesus. Uma nova entrada única na coleção de filmes clássicos de férias, este musical épico de Natal é diferente de todos os anteriores.","first_air_date":"2023-11-09","runtime":99,"episode_run_time":[99],"vote_average":7.9,"created_by":["Affirm Films","SPACE + ART Entertainment","Monarch Media","Night Light"],"production_companies":[{"name":"Affirm Films"},{"name":"SPACE + ART Entertainment"},{"name":"Monarch Media"},{"name":"Night Light"}],"cast":["Fiona Palomo","Milo Manheim","Omid Djalili","Rizwan Manji","Geno Segers"],"backdrop_path":"https://image.tmdb.org/t/p/original/qJlbMCpBZTvS5QZ7z2bFCYyRjSB.jpg","poster_path":"https://image.tmdb.org/t/p/original/tv0Ta1lAIZYuLKAcQhnRTe8bUTV.jpg","certification":"L","genres":["Família","Drama"],"trailer":"N/A"},
