"8780":{"id":"8780","name":"Uma Mãe para o Meu Bebê","slug":"uma-mae-para-o-meu-bebe","original_title":"Baby Mama","overview":"Surpreenda-se com Kate Holbrook, uma famosa mulher de negócios que durante um bom tempo deixou a vida pessoal de lado. Agora, aos 37 anos ela está decidida a ter um filho. Mas o sonho de ser mãe acaba quando descobre um problema que a impossibilita de engravidar. Determinada a ter um bebê a qualquer custo, ela resolve contratar uma barriga de aluguel e a eleita é Angie Ostrowiski. Kate vê sua vida organizada virar de cabeça para baixo quando Angie aparece na porta de sua casa alegando não ter onde ficar.","first_air_date":"2008-04-25","runtime":98,"episode_run_time":[98],"vote_average":6.0,"created_by":["Relativity Media","Michaels-Goldwyn","Universal Pictures"],"production_companies":[{"name":"Relativity Media"},{"name":"Michaels-Goldwyn"},{"name":"Universal Pictures"}],"cast":["Amy Poehler","Tina Fey","Greg Kinnear","Dax Shepard","Romany Malco"],"backdrop_path":"https://image.tmdb.org/t/p/original/hM6AttTwVdiL00jSAiIMsUutqMX.jpg","poster_path":"https://image.tmdb.org/t/p/original/ltsBPIVuX4hBgDXSmVa9Xg4drJl.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
