"300605":{"id":"300605","name":"Cidade de Deus: 10 Anos Depois","slug":"cidade-de-deus-10-anos-depois","original_title":"Cidade de Deus: 10 Anos Depois","overview":"Como o próprio título já diz, resgata os dez anos passados desde o lançamento de Cidade de Deus (2002), longa de Fernando Meirelles e Kátia Lund que recebeu quatro indicações ao Oscar. Procura mostrar as transformações vividas pelos atores do longa na última década. Deram entrevistas atores como Seu Jorge, Alice Braga, Leandro Firmino da Hora, Darlan Cunha, Roberta Rodrigues, dentre outros.","first_air_date":"2013-10-05","runtime":69,"episode_run_time":[69],"vote_average":6.8,"created_by":["Link Digital","Cavídeo Produções","Canal Brasil","Cinema Nosso","Nós do Morro","Berny Filmes"],"production_companies":[{"name":"Link Digital"},{"name":"Cavídeo Produções"},{"name":"Canal Brasil"},{"name":"Cinema Nosso"},{"name":"Nós do Morro"},{"name":"Berny Filmes"}],"cast":["Alexandre Rodrigues","Leandro Firmino","Roberta Rodrigues","Jonathan Haagensen","Seu Jorge"],"backdrop_path":"https://image.tmdb.org/t/p/original/omWsUgZcVWshTjHCHDxQ8740pgk.jpg","poster_path":"https://image.tmdb.org/t/p/original/iA4h5oong1fV9QboczoOITPDYbj.jpg","certification":"N/A","genres":["Documentário"],"trailer":"_rDLkVbZLwU"},
"446132":{"id":"446132","name":"Gauguin: Viagem ao Taiti","slug":"gauguin-viagem-ao-taiti","original_title":"Gauguin : Voyage de Tahiti","overview":"No ano de 1891, Gauguin se exila no Taiti. Ele quer reencontrar sua pintura livre, selvagem, longe dos códigos morais, políticos e estéticos da Europa civilizada. Ele se infiltra na selva, encarando a solidão, a pobreza, a doença. Lá, Gauguin conhece Tehura, que se tornará sua esposa e tema das suas telas mais importantes.","first_air_date":"2017-09-20","runtime":101,"episode_run_time":[101],"vote_average":5.7,"created_by":["Move Movie","StudioCanal","NJJ Entertainment","120 Films","Canal+","Ciné+","A+ Images 7","SofiTVciné 4","Cohen Media Group"],"production_companies":[{"name":"Move Movie"},{"name":"StudioCanal"},{"name":"NJJ Entertainment"},{"name":"120 Films"},{"name":"Canal+"},{"name":"Ciné+"},{"name":"A+ Images 7"},{"name":"SofiTVciné 4"},{"name":"Cohen Media Group"}],"cast":["Vincent Cassel","Tuheï Adams","Malik Zidi","Pua-Taï Hikutini","Marc Barbé"],"backdrop_path":"https://image.tmdb.org/t/p/original/gCAzSgwfQbHasmo0uUhPK9qzYmF.jpg","poster_path":"https://image.tmdb.org/t/p/original/j5tyY5ReaOr5ZFE8ttfoBzoaewr.jpg","certification":"14","genres":["Drama","Romance"],"trailer":"c2aYL7bLTRE"},
"214081":{"id":"214081","name":"Uma Promessa","slug":"uma-promessa","original_title":"A Promise","overview":"Alemanha, 1912. Um jovem diplomata (Richard Madden) ingressa no serviço administrativo de uma usina siderúrgica. Por conta do seu bom trabalho, seu patrão (Alan Rickman) o contrata para o posto de secretário particular. Conforme os dias passam, ele conhece e se aproxima da esposa (Rebecca Hall) do chefe, apaixonando-se perdidamente por ela. Ele recebe a missão de ir ao México repentinamente e, ao anunciar sua partida, a mulher entra em desespero, realizando que ambos se amam. Sendo assim, fazem uma promessa de amor: um dia ele irá retornar e os dois finalmente ficarão juntos.","first_air_date":"2013-09-04","runtime":94,"episode_run_time":[94],"vote_average":5.7,"created_by":["Wild Bunch","Fidélité Films","SCOPE Pictures","OCS","Cofinova 6"],"production_companies":[{"name":"Wild Bunch"},{"name":"Fidélité Films"},{"name":"SCOPE Pictures"},{"name":"OCS"},{"name":"Cofinova 6"}],"cast":["Rebecca Hall","Alan Rickman","Richard Madden","Toby Murray","Maggie Steed"],"backdrop_path":"https://image.tmdb.org/t/p/original/a3XL3zY9Jx5Zea1IBA9Ag4LUBxg.jpg","poster_path":"https://image.tmdb.org/t/p/original/p6QfDLXrO2PX5xAl2x2koJmwlNa.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"bjwWfbC33K0"},
