"4104":{"id":"4104","name":"Benny & Joon - Corações em Conflito","slug":"benny-joon-coracoes-em-conflito","original_title":"Benny & Joon","overview":"Benny e Joon são irmãos. Benny é um mecânico e, como irmão mais velho, toma conta de Joon, que tem deficiência mental. Quando Benny perde uma aposta, ele tem que fazer um favor a um amigo e trazer o excêntrico Sam, um rapaz que vive imitando Charlie Chaplin e Buster Keaton, para a sua casa. Sam e Joon se apaixonam e, pela primeira vez, Benny se vê com ciúme da irmã, com medo de perdê-la, mas tendo que aceitar que ela pode (e quer) ter a sua própria vida.","first_air_date":"1993-04-16","runtime":98,"episode_run_time":[98],"vote_average":7.0,"created_by":["Roth-Arnold Productions","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Roth-Arnold Productions"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Johnny Depp","Mary Stuart Masterson","Aidan Quinn","Julianne Moore","Oliver Platt"],"backdrop_path":"https://image.tmdb.org/t/p/original/2TkuCpt75P5CyRgW1606dkY4JwM.jpg","poster_path":"https://image.tmdb.org/t/p/original/mm4EvxBSsvIkx6ilaJJ8w5F6QpY.jpg","certification":"12","genres":["Comédia","Drama"],"trailer":"N/A"},
